		return axios.post(`${SERVER_URL}/api/login`, { email, password });
	} catch (error) {
		console.log("Error in userLogin API: ", error);
	}
};

export const userRegister = async (data) => {
	const { name, email, password } = data;
	try {
		axios.post(`${SERVER_URL}/api/register`, { name, email, password });
		return console.log("User Registered Successfully", data);
	} catch (error) {
		console.log("Error in userLogin API: ", error);
	}
};
